        body, ul, li{

        body{

        nav{
            height: 64px;
            background-color: orange;
        }

        nav li{
            float: left;
        }
        nav div{

        }

        hr{
            opacity: 0;
            clear: both;
        }
        .Terrain{
            float:left;
            background-color: green;
            padding: 25px 64px;
            border-top:10px;
            border-bottom:10px;
            border-left:10px;
            border-right:10px;
            border-top-style: solid;
            border-bottom-style: dashed;
            border-left-style: dotted;
            border-right-style: groove;
            border-top-color: yellow;
            border-bottom-color: pink;
            border-left-color: cyan;
            border-right-color: magenta;
            /* border : 1px solid yellow; */
            margin : 20px 10px;
        }
        .Maison{
            background-color: red;
            width:256px;
            height: 372px;
        }

        .radius{
            border-radius: 25px 10px 0px 45px;
        }

        .search-bar{
            width: 256px;
            height: 64px;
            border: 3px white solid;
            border-radius: 36px;
        }

        .perfect-circle{
            width: 256px;
            height: 256px;
            border: 3px white solid;
            border-radius:50%;
            overflow: hidden;
        }

        .perfect-circle img{
            width: 100%;
        }
    </style>
